import React, { Component } from 'react'

export default class Child_1 extends Component {
  render() {
    return (
      <div className='col-3'>
        <div className='bg-light p-2 text-dark'>
          <h2>{this.props.type}</h2>
          <h2>{this.props.productName}</h2>
          <h2>{this.props.productPrice}</h2>
        </div>
      </div>
    )
  }
}
